import React, { useState, useEffect } from 'react';
import logo from './logo.svg';


function Dd() {
    const [normal, setNormal] = useState(0)

    useEffect(() => {
        fetch('/bebe').then(res => res.json()).then(data => {
            setNormal(data.normal)
        })
    }, [])
    const [vrs, setVrs] = useState(0)

    useEffect(() => {
        fetch('/bebe').then(res => res.json()).then(data => {
            setVrs(data.vrs)
        })
    }, [])
    const [bkt, setBkt] = useState(0)

    useEffect(() => {
        fetch('/bebe').then(res => res.json()).then(data => {
            setBkt(data.bakteri)
        })
    }, [])

    return (
        <div>
            Flasktan gelen değer = {normal}
            Flasktan gelen değer = {vrs}
            Flasktan gelen değer = {bkt}
        </div>
    );
}

export default Dd;
